import './App.css';
import React from 'react';
import AddAppointment from './addAppointment';
import AddDoctors from './addDoctors';
import AddPatients from './addPatients';

import FinalDb from './finalDb';
import FinalPdb from './finalPdb'
import Finaldoctorsdb from './finaldoctorsdb';
import UserLogin from './userLogin';
import {BrowserRouter as  Route, Routes} from 'react-router-dom';
import LoginForm from './loginForm';





 function App() {
  return (

      <Routes>
        <Route path = "/" element = {<UserLogin />}/>
        <Route />

        <Route exact path='/loginForm'>
          <LoginForm />
        </Route>

        <Route exact path='/finaldoctorsdb'>
          <Finaldoctorsdb />
        </Route>

        <Route exact path='/finalDb'>
          <FinalDb />
        </Route>

        <Route exact path='/finalPdb'>
          <FinalPdb />
        </Route>

        <Route exact path='/addAppointment'>
          <AddAppointment />
        </Route>

        <Route exact path='/addDoctors'>
          <AddDoctors />
        </Route>

        <Route exact path='addPatients'>
          <AddPatients />
        </Route>
      </Routes>

  )
}

export default App;
